import './App.css';

const styles = {
    mainContainer: {
        display: "flex",
        justifyContent: "center"
    },
    routsContainer: {
        display: "flex",
        justifyContent: "center",
        flexDirection: "column",
        border:"1px solid black",
        width:"600px",
        padding:"10px 10px 20px 10px",
        borderRadius:"10px"
    }
}
function App() {
  return (
    <div style={styles.mainContainer}>
      <div style={styles.routsContainer}>
        <h1>Pet Shelter</h1>
      </div>
    </div>
  );
}

export default App;
